import React from "react";

const Payment=()=>{
    return(
        <div>
            <h1>Payment Page</h1>
            <input className="inputbox" type="text"
            value={email} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter EMAIL"/>
        </div>
    )
}

export default Payment;
